// SPDX-License-Identifier: MIT
// 傳進rate的值
pragma solidity ^0.8.0;

contract E00010001 {

    event EventIdAndRateReceived(string eventId, uint256 SP002, uint256 SP003, uint256 SP004);
    uint256 latestSP002;
    uint256 latestSP003;
    uint256 latestSP004;
    string  eventIdFromTimeSpan;


    function getEventIdAndRate(string memory _eventId, uint256 _SP002, uint256 _SP003, uint256 _SP004) public {
        latestSP002 = _SP002;
        latestSP003 = _SP003;
        latestSP004 = _SP004;
        eventIdFromTimeSpan = _eventId;
        emit EventIdAndRateReceived(_eventId, _SP002, _SP003, _SP004);
    }

}

